        <div className="">Following</div>
        <div className="">Message</div>
        <div className="">icon</div>
        <div className="">icon</div>
      </div>

      <div className="dates">
        <div className="">post</div>
        <div className="">followers</div>
        <div className="">following</div>
      </div>

      <div className=""></div>
      <div className=""></div>
    </header>
  );
};
